import { Route } from 'react-router-dom';

const routes = {
  home: '/',
  aboutUs: '/about-us',
  tests: '/tests/',
  companies: '/companies',
  users: '/users',
  userRegistration: '/registration/user',
  companyRegistration: '/registration/company',
  autorization: '/authorization/',
  userProfile: '/:user/:text',
  companyProfile: '/:company/:text',
  companyAddTests: '/:company/add-test',
  companyEditTests: '/:company/edit-test',
  userStartTest: '/:user/start-test',

};

class NamedRoute extends Component  {
  static computeMatch({ name, ...rest }, router) {
    const path = routes[name] || '/';

    return Route.computeMatch({ path, ...rest }, router);
  }

  render() {
    return <Route {...this.props} />;
  }
}
export default NamedRoute;
